import base64, os

# These are the clean base64-encoded files
files = {
    "src/app/dashboard/page.tsx": "",
    "src/app/screener/page.tsx": "",
    "src/app/formula/new/page.tsx": "",
}

for path, b64 in files.items():
    os.makedirs(os.path.dirname(path), exist_ok=True)
    with open(path, 'w') as f:
        f.write(base64.b64decode(b64).decode('utf-8'))
    print(f" {path} written ({len(base64.b64decode(b64).decode('utf-8').splitlines())} lines)")

print("\nDone! Now run: npm run build")
